$(function(){var t=[];$.getJSON("file_list.json",function(n){$.each(n,function(n,i){t[n]=i.split(".")[0]})}).done(function(){$(".file-list tbody tr").each(function(){for(var n=0;n<t.length;n++){if($(this).children("td:last-child").text()==t[n]){$(this).append('<td class="center"><a href="../html/'+t[n]+'.html" class="list-link" target="blonk"> DONE </a></td>');break}n==t.length-1&&$(this).append('<td class="center">X</td>')}$(this).children("td").has("s").length&&$(this).children("td").addClass("cancel")})}),$("body").on("click","tr",function(t){$(this).find(".list-link").length?window.open($(this).find(".list-link").attr("href")):$(this).find(".cancel").length?alert("제작이 취소된 페이지 입니다"):alert("준비 중 입니다.")})});